import React, { useState, useEffect } from "react";
import { AppBar, Typography, Toolbar, Avatar, Button, TextField, Dialog, DialogContent, DialogActions } from "@material-ui/core";
import { Link, useHistory, useLocation } from "react-router-dom";
import { useDispatch } from "react-redux";
import decode from "jwt-decode";

import memoriesLogo from "../../images/memoriesLogo.png";
import memoriesText from "../../images/memoriesText.png";
import * as actionType from "../../constants/actionTypes";
import useStyles from "./styles";

const Navbar = () => {
  const [user, setUser] = useState(JSON.parse(localStorage.getItem("profile")));
  const [productId, setProductId] = useState(''); // Assuming you will manage to get this from elsewhere
  const [openDialog, setOpenDialog] = useState(false);
  const dispatch = useDispatch();
  const location = useLocation();
  const history = useHistory();
  const classes = useStyles();

  const logout = () => {
    dispatch({ type: actionType.LOGOUT });
    history.push("/auth");
    setUser(null);
  };

  useEffect(() => {
    const token = user?.token;
    if (token) {
      const decodedToken = decode(token);
      if (decodedToken.exp * 1000 < new Date().getTime()) logout();
    }
    setUser(JSON.parse(localStorage.getItem("profile")));
  }, [location]);

  const handleViewBuyers = () => {
    if (productId) {
      const url = `http://localhost:3001/api/purchases/${productId}`;
      window.open(url, '_blank');
    } else {
      alert("Product ID is required.");
    }
  };

  const handleOpenDialog = () => {
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
  };

  return (
    <AppBar className={classes.appBar} position="static" color="inherit">
      <Link to="/" className={classes.brandContainer}>
        <img src={memoriesText} alt="icon" height="46px" />
        <img className={classes.image} src={memoriesLogo} alt="icon" height="50px" />
      </Link>
      <Toolbar className={classes.toolbar}>
        {user?.result ? (
          <div className={classes.profile}>
            <Avatar className={classes.purple} alt={user?.result.name} src={user?.result.imageUrl}>{user?.result.name.charAt(0)}</Avatar>
            <Typography className={classes.userName} variant="h6">{user?.result.name}</Typography>
            <Button variant="contained" className={classes.logout} color="secondary" onClick={logout}>Logout</Button>
            {user?.result.isAdmin && (
              <>
                <Button variant="contained" color="primary" onClick={handleOpenDialog}>Set Product ID</Button>
                <Button variant="contained" color="primary" onClick={handleViewBuyers}>View Buyers</Button>
              </>
            )}
          </div>
        ) : (
          <Button component={Link} to="/auth" variant="contained" color="primary">Sign In</Button>
        )}
      </Toolbar>
      <Dialog open={openDialog} onClose={handleCloseDialog}>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            id="productId"
            label="Product ID"
            type="text"
            fullWidth
            value={productId}
            onChange={(e) => setProductId(e.target.value)}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog} color="primary">Cancel</Button>
          <Button onClick={handleViewBuyers} color="primary">Open Purchases</Button>
        </DialogActions>
      </Dialog>
    </AppBar>
  );
};

export default Navbar;
